  false,\n\t\"url\": null,\n\t\"notes\": \"The MOYOCO (MT) Invasive Species Strike
  Team is made up of two field strike teams, housed at Benton Lake and Lee Metcalf
  National Wildlife Refuges, yet administered by the Region 6 Invasive Species Program.
  \ The teams conduct invasive plant management on National Wildlife Refuges and Waterfowl
  Production Areas in Montana and northern Wyoming.  Several invasive plant species
  are chemically, biologically and manually treated, inventoried, and monitored. Annually
  a final report is provided describing all projects completed. The full final report
  includes an overall summary and a \"chapter\" for each national wildlife refuge
  or waterfowl management district.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
